insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('1001', 'Kanto', 'Professor Oak', 'Bulbusaur, Charmander and Squirtle', 'Brock, Misty, Lt. Surge, Erika, Koga, Sabrina, Blaine, Giovanni', 'Kanto features predominantly forests and plains, with centrally located major cities providing access to various environments, including the sea and mountains. The region has a mix of urban cities and rural towns, with several mountain ranges, primarily in the north and west, including the Indigo Plateau and Victory Road range that separates it from Johto.', 'https://archives.bulbagarden.net/media/upload/thumb/2/25/LGPE_Kanto_Map.png/600px-LGPE_Kanto_Map.png');
insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('2002', 'Johto', 'Professor Elm', 'Chikorita, Cyndaquil, and Totodile', 'Falkner, Bugsy, Whitney, Morty, Chuck, Jasmine, Pryce, Clair', 'Johto is a predominantly rural region compared to Kanto, featuring water to the west and south, with Goldenrod City at its core as the economic and technological hub, connected to smaller towns. Its land-dominated, with a vast eastern mountain range separating it from Kanto and housing Blackthorn City, known for Dragon Tamers.', 'https://daily.pokecommunity.com/wp-content/uploads/2020/05/Johto_HGSSmap-1038x576.png');
insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('3003', 'Hoenn', 'Professor Birch', 'Treecko, Torchic, and Mudkip', 'Roxanne, Brawly, Wattson, Flannery, Norman, Winona, Tate and Liza, Juan', 'The Hoenn region is known for its diverse environments, including rainforests and deserts, but its standout feature is its extensive water coverage, in stark contrast to other regions, particularly Sinnoh. The region is almost evenly split between land and water, with numerous islands accessible via water routes, some deep enough for diving, showcasing the regions aquatic theme.', 'https://archives.bulbagarden.net/media/upload/8/85/Hoenn_ORAS.png');
insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('4004', 'Sinnoh', 'Professor Rowan', 'Turtwig, Chimchar, and Piplup', 'Roark, Gardenia, Maylene, Crasher Wake, Fantina, Byron, Candice, Volkner', 'Sinnoh offers diverse environments, including snowy routes for the first time in a Pokémon RPG, with varying terrain from dry mountains to wet swamps, and a rich presence of water. Its a large region divided into two sub-regions by Mount Coronet, resulting in unique regional speciation for Pokémon like Shellos and Gastrodon, with blue-colored variants in the east and pink-colored variants in the west.', 'https://archives.bulbagarden.net/media/upload/thumb/0/08/Sinnoh_BDSP_artwork.png/600px-Sinnoh_BDSP_artwork.png');
insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('5005', 'Unova', 'Professor Juniper', 'Snivy, Tepig and Oshawott', 'Cilan, Chili, and Cress , Lenora, Burgh, Elesa, Clay, Skyla, Brycen, Drayden or Iris', 'Unova showcases a blend of urban and rural areas across its 21 settlements, with cities like Castelia resembling real-world metropolises and places like Humilau City maintaining a more traditional aesthetic. The region also features forests, a desert, a magnetic cave, and dive spots. Unovas technological advancement varies between versions, with Pokémon Black focusing on technology, while Pokémon White has a more rural appearance.', 'https://archives.bulbagarden.net/media/upload/thumb/f/fc/Unova_B2W2_alt.png/600px-Unova_B2W2_alt.png');
insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('6006', 'Kalos', 'Professor Sycamore', 'Chespin, Fennekin, and Froakie', 'Viola, Grant, Korrina, Ramos, Clemont, Valerie, Olympia, Wulfric', 'Kalos exhibits diverse geography, with natural borders formed by an expansive ocean to the west and northwest, and mountain ranges defining its eastern and southern limits. This configuration gives the region its iconic star-shaped appearance, with a large peninsula reaching into the sea in the northwest. Kalos is divided into three distinct divisions, each with unique geography and Pokémon: Central Kalos, Coastal Kalos, and Mountain Kalos. Lumiose City, a bustling metropolis, sits near the convergence point of these divisions, making it a central hub in the region.', 'https://archives.bulbagarden.net/media/upload/thumb/8/8a/Kalos_alt.png/600px-Kalos_alt.png');
insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('7007', 'Alola', 'Professor Kukui', 'Rowlet, Litten, and Popplio', 'Ilima, Lana, Kiawe, Mallow, Sophocles, Acerola, Mina', 'Alola is a diverse tropical paradise with a rich array of environments, from pristine beaches and dense jungles to volcanic mountains and snowy peaks. Each of its four main islands offers unique terrain and habitats, making it a captivating destination for both Pokémon and Trainers. The regions lush vegetation, coastal beauty, and vibrant flora are complemented by its warm tropical climate, creating a picturesque setting for exploration and adventure.', 'https://archives.bulbagarden.net/media/upload/thumb/0/0b/Alola_USUM_artwork.png/600px-Alola_USUM_artwork.png');
insert into regions (regionId, regionName, professor, starterPokemons, gym_leaders, geography, regionURL) values ('8008', 'Galar', 'Professor Magnolia Sonia', 'Grookey, Scorbunny, and Sobble', 'Milo, Nessa, Kabu, Bea or Allister, Opal, Gordie or Melony, Piers, Raihan', 'The Galar region is an expansive region, including varied environments such as idyllic countrysides, contemporary cities, and snow-covered mountains. Galar comprises a long mainland area as well as an outlying island area, the Isle of Armor, east of the mainland.', 'https://archives.bulbagarden.net/media/upload/f/fd/Paldea_artwork.png');
